    <style>
        body {
            margin: 0;
            padding: 8px;
            font-family: 'Segoe UI', Arial, sans-serif;
            background: linear-gradient(135deg, #FF5722 0%, #4CAF50 100%);
            min-height: 100vh;
            zoom: 0.85;
        }
        
        .dashboard-header {
            text-align: center;
            color: white;
            margin-bottom: 12px;
            text-shadow: 2px 2px 4px rgba(0,0,0,0.3);
            padding: 8px;
        }
        
        .dashboard-title {
            font-size: 1.6rem;
            margin: 0 0 6px 0;
            font-weight: 700;
        }
        
        .dashboard-subtitle {
            font-size: 0.85rem;
            margin: 0 0 4px 0;
            opacity: 0.9;
        }
        
        .ai-info {
            font-size: 0.75rem;
            opacity: 0.8;
            font-style: italic;
        }
        
        .charts-grid {
            display: grid;
            grid-template-columns: repeat(4, 1fr);
            grid-template-rows: repeat(2, 1fr);
            gap: 6px;
            height: calc(100vh - 90px);
            max-width: 100vw;
            margin: 0 auto;
            padding: 0 6px;
        }
        
        .chart-item {
            background: white;
            border-radius: 6px;
            box-shadow: 0 3px 12px rgba(0,0,0,0.1);
            overflow: hidden;
            transition: all 0.3s ease;
            border: 2px solid transparent;
            position: relative;
            cursor: zoom-in;
            min-height: 160px;
        }
        
        .chart-item:hover {
            transform: scale(1.03);
            box-shadow: 0 6px 20px rgba(0,0,0,0.15);
            border-color: #2196F3;
            z-index: 10;
        }
        
        .chart-item:nth-child(1) {
            grid-column: span 2;
            border-left: 4px solid #FF5722;
        }
        
        .chart-item:nth-child(2) {
            grid-column: span 2;
            border-left: 4px solid #4CAF50;
        }
        
        .chart-item:nth-child(3) {
            border-left: 4px solid #2196F3;
        }
        
        .chart-item:nth-child(4) {
            border-left: 4px solid #FF9800;
        }
        
        .chart-item:nth-child(5) {
            border-left: 4px solid #9C27B0;
        }
        
        .chart-item:nth-child(6) {
            border-left: 4px solid #00BCD4;
        }
        
        .chart-item:nth-child(7) {
            border-left: 4px solid #CDDC39;
        }
        
        .chart-item .plotly-graph-div {
            height: 100% !important;
            width: 100% !important;
        }
        
        .chart-item.zoomed {
            position: fixed;
            top: 3%;
            left: 3%;
            width: 94vw;
            height: 94vh;
            z-index: 1000;
            transform: none;
            cursor: zoom-out;
            border-radius: 12px;
            box-shadow: 0 20px 50px rgba(0,0,0,0.3);
        }
        
        .chart-backdrop {
            position: fixed;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
            background: rgba(0,0,0,0.7);
            z-index: 999;
            display: none;
        }
        
        .chart-backdrop.active {
            display: block;
        }
        
        .ai-badge {
            position: absolute;
            top: 12px;
            right: 12px;
            background: rgba(255,255,255,0.2);
            color: white;
            padding: 4px 8px;
            border-radius: 12px;
            font-size: 0.65rem;
            backdrop-filter: blur(10px);
            border: 1px solid rgba(255,255,255,0.3);
        }
        
        @media (max-width: 1400px) {
            body { zoom: 0.75; }
            .charts-grid {
                grid-template-columns: repeat(3, 1fr);
                grid-template-rows: repeat(3, auto);
                height: calc(100vh - 80px);
                gap: 4px;
            }
        }
        
        @media (max-width: 1000px) {
            body { zoom: 0.7; }
            .charts-grid {
                grid-template-columns: repeat(2, 1fr);
                gap: 4px;
            }
        }
        
        @media (max-width: 700px) {
            body { zoom: 1.0; }
            .charts-grid {
                grid-template-columns: 1fr;
                height: auto;
                gap: 8px;
            }
        }
    </style>
</head>

    <div class="chart-backdrop"></div>
    
    <script>
        document.addEventListener('DOMContentLoaded', function() {
            const backdrop = document.querySelector('.chart-backdrop');
            const charts = document.querySelectorAll('.chart-item');
            
            charts.forEach((chart, index) => {
                chart.style.animationDelay = `${index * 0.1}s`;
                chart.style.animation = 'slideInUp 0.6s ease forwards';
                
                chart.addEventListener('click', function() {
                    if (chart.classList.contains('zoomed')) {
                        exitZoom();
                    } else {
                        enterZoom(chart);
                    }
                });
            });
            
            backdrop.addEventListener('click', exitZoom);
            
            document.addEventListener('keydown', function(e) {
                if (e.key === 'Escape') exitZoom();
            });
            
            function enterZoom(chart) {
                exitZoom();
                backdrop.classList.add('active');
                chart.classList.add('zoomed');
                
                setTimeout(() => {
                    const plotlyDiv = chart.querySelector('.plotly-graph-div');
                    if (plotlyDiv && window.Plotly) {
                        window.Plotly.Plots.resize(plotlyDiv);
                    }
                }, 300);
                
                document.body.style.overflow = 'hidden';
            }
            
            function exitZoom() {
                backdrop.classList.remove('active');
                charts.forEach(chart => {
                    chart.classList.remove('zoomed');
                    setTimeout(() => {
                        const plotlyDiv = chart.querySelector('.plotly-graph-div');
                        if (plotlyDiv && window.Plotly) {
                            window.Plotly.Plots.resize(plotlyDiv);
                        }
                    }, 300);
                });
                document.body.style.overflow = 'auto';
            }
        });
        
        const style = document.createElement('style');
        style.textContent = `
            @keyframes slideInUp {
                from { opacity: 0; transform: translateY(30px); }
                to { opacity: 1; transform: translateY(0); }
            }
            .chart-item { opacity: 0; }
        `;
        document.head.appendChild(style);
    </script>
